import React, { useState } from "react";
import Home from "./Home";
import Login from "./Login";
import Board from "./Board";
import MyPage from "./MyPage";
import Admin from "./Admin";
import List from "./List";
import Map from "./Map";
import { Link } from "react-router-dom";

const Test = () => {
  const [currentComponent, setCurrentComponent] = useState("Home");
  const [activeItem, setActiveItem] = useState("Home");

  const renderComponent = () => {
    switch (currentComponent) {
      case "Home":
        return <Home />;
      case "Login":
        return <Login />;
      case "Admin":
        return <Admin />;
      case "List":
        return <List />;
      case "Board":
        return <Board />;
      case "MyPage":
        return <MyPage />;
      case "Map":
        return <Map />;

      default:
        return <Home />;
    }
  };

  const handleClick = (component) => {
    setCurrentComponent(component);
    setActiveItem(component);
  };

  return (
    <section id="wrap">
      <div id="side">
        <div className="side__text">
          <ul>
            <h1>
              <Link to="/home">Druwa</Link>
            </h1>
          </ul>
          <ul>
            <li
              className={activeItem === "Home" ? "active" : ""}
              onClick={() => {
                handleClick("Home");
                setCurrentComponent("Home");
              }}
            >
              <div className="index__text">
                <h3>메인페이지</h3>
                <p>60%</p>
              </div>
              <div className="progress-bar">
                <div className="progress" style={{ width: "60%" }}></div>
              </div>
            </li>
            <li
              className={activeItem === "List" ? "active" : ""}
              onClick={() => {
                handleClick("List");
                setCurrentComponent("List");
              }}
            >
              <div className="index__text">
                <h3>전체 리스트</h3>
                <p>40%</p>
              </div>
              <div className="progress-bar">
                <div className="progress" style={{ width: "40%" }}></div>
              </div>
            </li>
            <li
              className={activeItem === "Board" ? "active" : ""}
              onClick={() => {
                handleClick("Board");
                setCurrentComponent("Board");
              }}
            >
              <div className="index__text">
                <h3>공지사항</h3>
                <p>30%</p>
              </div>
              <div className="progress-bar">
                <div className="progress" style={{ width: "30%" }}></div>
              </div>
            </li>
            <li
              className={activeItem === "MyPage" ? "active" : ""}
              onClick={() => {
                handleClick("MyPage");
                setCurrentComponent("MyPage");
              }}
            >
              <div className="index__text">
                <h3>마이페이지</h3>
                <p>30%</p>
              </div>
